import styled from 'styled-components';
import { motion } from 'framer-motion';

export const ArtistsStyled = styled(motion.div)`
  width: 100vw;
  display: grid;
  grid-template-columns: 20% 20% 20% 20% 20%;
  grid-gap: 0;
  opacity:0.3;
`;
